-- (?=.*value1)(?=.*value2) use Regex for searching in UE4SS (make sure to right click search bar and enable regex for searching in live view)
-- Useful for finding Color types for a certain character, for example:
-- (?=.*color)(?=.*zbr) finds strings that have both "color" and "zbr" in it 
-- (?=.*color)(?=.*zbr)(?=.*DataInterface) -- Dont use, this is (?=.*DataInterface) slow as checks whole string for Datainterface instead of start, use ^NiagaraDataInterfaceColorCurve instead
-- ^NiagaraDataInterfaceColorCurve(?=.*saifu) (Regex that searches for strings that starts with NiagaraDataInterfaceColorCurve and has saifu in it)
-- "zbr" is Reina, check https://tekkenmods.com/article/78 "Character Abbreviatons" for a specific character 
-- ^[^ ]*substring[^ ]* Class/Type has substring in its name, for example ^[^ ]*character[^ ]* finds BP_character types, BaseCharacterItem types PolarisCharacter ... etc
-- Im talking about using this in UE4SS's Live View (zDev version on github) (On live view Right click on its search bar and enable Regex searching)
local function PrintRemixLooker(string) -- Adds [RemixNiagaraDataColorTest] to all of our Prints() for debugging + clarity, also allows for easy turning off, just add a return 
        if true then 
            return
        end
        local aString = "[Remix Rainbow Electrics All Charcters]: " .. string .. "\n"
        print(aString)
end
