function ColorLUTArray(lutArray,color1,color2,color3)
    local colorR = color1 / 255 -- Puts between 0-1 (Normalises)
    local colorG = color2 / 255 -- Puts between 0-1 (Normalises)
    local colorB = color3 / 255 -- Puts between 0-1 (Normalises)
    for i = 1, #lutArray, 4 do
        -- LutArray's format is {R,G,B,A,R,G,B,A,.... }
        lutArray[i]     = colorR 
        lutArray[i + 1] = colorG  
        lutArray[i + 2] = colorB 
    end
    return lutArray
end
